import React from 'react'
import {Container,Row,Button} from 'reactstrap'
import { NavLink,Link } from 'react-router-dom';

 const nav_link=[
  {
    Path:'/home',
    display:'Home'
  },
  {
    Path:'#',
    display:'About'
  },
  {
    Path:'/tours',
    display:'Tours'
  },
 ]

function Header() {
  return <header className='header' >
    <Container>
      <Row>
        .nav_w
      </Row>
    </Container>

  </header>
}

export default Header
